import React from 'react';
import Slider from "react-slick"; // Import react-slick
import './TrendingDesigns.css';
import image10 from '../../assets/images/trending1.jpg';
import image11 from '../../assets/images/trending2.jpg'; // Add other images
import image12 from '../../assets/images/trending3.jpg';

const TrendingDesigns = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 3, // Number of images to show
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 3000,
    responsive: [
      {
        breakpoint: 1024,
        settings: {
          slidesToShow: 2,
          slidesToScroll: 1,
          infinite: true,
          dots: true
        }
      },
      {
        breakpoint: 768,
        settings: {
          slidesToShow: 1,
          slidesToScroll: 1
        }
      }
    ]
  };

  return (
    <section className="trending-designs">
      <h2>Trending Designs</h2>
      <Slider {...settings} className="design-slider">
        <div className="design-card">
          <img src={image10} alt="OBSIDIAN BANK" />
          <p>OBSIDIAN BANK</p>
        </div>
        <div className="design-card">
          <img src={image11} alt="EUREKA VISION THEATER" />
          <p>EUREKA VISION THEATER</p>
        </div>
        <div className="design-card">
          <img src={image12} alt="ROSETON BUILDING" />
          <p>ROSETON BUILDING</p>
        </div>
      </Slider>
    </section>
  );
};

export default TrendingDesigns;
